import React from "react";
import { Form, Input, Button, notification, Row } from "antd";
import { useState } from "react";

const mockData = {
  userlistName: "Students",
  users: [
    {
      age: 25,
      name: "John"
    },
    {
      age: 23,
      name: "Marry"
    },
    {
      age: 42,
      name: "Kyle"
    }
  ]
};

const AddArticle = () => {
  const [data, setData] = useState(mockData);
  const formItemLayout = {};

  const onFinish = (values) => {
    notification.success({
      message: "Submit",
      description: `Received values of form: ${JSON.stringify(values)}`
    });
    setData(values);
  };

  const onReset = () => {
    notification.info({
      message: "Reset",
      description: "Fields reset to original values."
    });
  };

  return (
    <section className="CommentsWrapper">
      <h2>PROPOSE AN ARTICLE FOR A ROAMING AGREEMENT</h2>
      <Form
        {...formItemLayout}
        name="dynamic_form_item"
        onFinish={onFinish}
        initialValues={data}
      >
      </Form>
    </section>
  );
};

export default AddArticle;
